import React, { useEffect, useState, useRef } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [animalCounts, setAnimalCounts] = useState({});
  const videoRef = useRef(null);

  useEffect(() => {
    // Fetch animal counts every 5 seconds
    const fetchCounts = async () => {
      try {
        const response = await axios.get('http://localhost:5000/animal_counts');
        setAnimalCounts(response.data);
      } catch (error) {
        console.error('Error fetching animal counts:', error);
      }
    };

    fetchCounts(); // Initial fetch
    const interval = setInterval(fetchCounts, 5000); // Update every 5 seconds

    return () => clearInterval(interval); // Cleanup on component unmount
  }, []);

  return (
    <div className="App">
      <h1>Real-time Object Detection</h1>
      <div>
        <img 
          src="http://localhost:5000/video_feed" 
          alt="Video Feed" 
          ref={videoRef} 
          style={{ width: '80%', height: 'auto' }} 
        />
      </div>
      <div id="counts" style={{ marginTop: '20px' }}>
        <h2>Animal Counts:</h2>
        <table>
          <thead>
            <tr>
              <th>Animal</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(animalCounts).map(([animal, count]) => (
              <tr key={animal}>
                <td>{animal}</td>
                <td>{count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
